import React, { useState, useEffect } from "react";
import { Sun, Moon, Menu, X, Bell } from "lucide-react";
import { Link } from "react-router-dom";
import ProfileMenu from "../ProfileMenu/ProfileMenu"; // Correct import
import "./Navbar.css";

const Navbar = () => {
  const [theme, setTheme] = useState("light");
  const [menuOpen, setMenuOpen] = useState(false);

  // Load theme from localStorage
  useEffect(() => {
    const savedTheme = localStorage.getItem("theme") || "light";
    setTheme(savedTheme);
    document.body.className = savedTheme;
  }, []);

  // Toggle dark/light theme
  const toggleTheme = () => {
    const nextTheme = theme === "light" ? "dark" : "light";
    setTheme(nextTheme);
    document.body.className = nextTheme;
    localStorage.setItem("theme", nextTheme);
  };

  // Handle notifications
  const handleNotification = () => {
    alert("You have no new notifications!");
  };

  // Mock user state
  const [user, setUser] = useState({ name: "John Doe" }); // Replace with auth logic

  const handleSignOut = () => {
    setUser(null); // Log out
    window.location.href = "/"; // Redirect home
  };

  const handleSignIn = () => {
    setUser({ name: "John Doe" }); // Log in
    window.location.href = "/"; // Redirect home
  };

  return (
    <header className={`navbar ${theme}`}>
      <div className="navbar__container">
        <div className="navbar__left">
          <div className="logo">🌤️ WeatherMate 🌦️</div>
          <ul className="navbar__links">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/news">News</Link></li>
            <li><Link to="/settings">Settings</Link></li>
          </ul>
        </div>

        <div className="navbar__right">
          <button className="icon-btn" onClick={handleNotification}>
            <Bell size={18} />
          </button>

          <button className="icon-btn" onClick={toggleTheme}>
            {theme === "light" ? <Moon size={18} /> : <Sun size={18} />}
          </button>

          {/* ProfileMenu component handles Sign In / Sign Out */}
          <ProfileMenu
            user={user}
            onSignOut={handleSignOut}
            onSignIn={handleSignIn}
          />

          <button className="menu-btn" onClick={() => setMenuOpen(!menuOpen)}>
            {menuOpen ? <X size={20} /> : <Menu size={20} />}
          </button>
        </div>
      </div>

      {/* Mobile menu */}
      {menuOpen && (
        <div className={`mobile-menu ${theme}`}>
          <Link to="/" onClick={() => setMenuOpen(false)}>Home</Link>
          <Link to="/about" onClick={() => setMenuOpen(false)}>About</Link>
          <Link to="/news" onClick={() => setMenuOpen(false)}>News</Link>
          <Link to="/settings" onClick={() => setMenuOpen(false)}>Settings</Link>
        </div>
      )}
    </header>
  );
};

export default Navbar;
